Web applications MongoDB database structure<p>I have simple web application in Spring boot to creating a CV profile.
Profile is my primary model and I want to add another section Education that I can easly add, remove and update new fields of that section.</p>

<pre><code>Profile.class

@Data
@AllArgsConstructor
@Document(collection = "profiles")
public class Profile {

    @Id
    private String id;
    private String firstName;
    private String lastName;
    private List&lt;Education&gt; education;
}

Education.class

@Data
public class Profile {

    private LocalDate startDate;
    private LocalDate endDate;
    private String description;

}

</code></pre>

<p>Theres no problem with add new education object ,but I have a problem with finding Education object to remove or update in list. </p>

<p>Is there a better way to create sub-document in MongoDB that I can easly  find some object and remove or update them ?</p>

