How to make Mongoose update work with await?<p>I'm creating a NodeJS backend where a process reads in data from a source, checks for changes compared to the current data, makes those updates to MongoDB and reports the changes made. Everything works, except I can't get the changes reported, because I can't get the Mongoose update action to await.</p>

<p>The returned array from this function is then displayed by a Koa server. It shows an empty array, and in the server logs, the correct values appear after the server has returned the empty response.</p>

<p>I've digged through Mongoose docs and Stack Overflow questions – quite a few questions about the topic – but with no success. None of the solutions provided seem to help. I've isolated the issue to this part: if I remove the Mongoose part, everything works as expected.</p>

<pre><code>const parseJSON = async xmlData =&gt; {
    const changes = []

    const games = await Game.find({})
    const gameObjects = games.map(game =&gt; {
        return new GameObject(game.name, game.id, game)
    })

    let jsonObj = require("../sample.json")
    Object.keys(jsonObj.items.item).forEach(async item =&gt; {
        const game = jsonObj.items.item[item]
        const gameID = game["@_objectid"]
        const rating = game.stats.rating["@_value"]
        if (rating === "N/A") return
        const gameObject = await gameObjects.find(
            game =&gt; game.bgg === parseInt(gameID)
        )
        if (gameObject &amp;&amp; gameObject.rating !== parseInt(rating)) {
            try {
                const updated = await Game.findOneAndUpdate(
                    { _id: gameObject.id },
                    { rating: rating },
                    { new: true }
                ).exec()
                changes.push(
                    `${updated.name}: ${gameObject.rating} -&gt; ${updated.rating}`
                )
            } catch (error) {
                console.log(error)
            }
        }
    })

    return changes
}
</code></pre>

<p>Everything works – the changes are found and the database is updated, but the reported changes are returned too late, because the execution doesn't wait for Mongoose.</p>

<p>I've also tried this instead of <code>findOneAndUpdate()</code>:</p>

<pre><code>const updated = await Game.findOne()
    .where("_id")
    .in([gameObject.id])
    .exec()
updated.rating = rating
await updated.save()
</code></pre>

<p>The same results here: everything else works, but the async doesn't.</p>

