Mongoose overwriting data in MongoDB with default values in Subdocuments<p>I currently have a problem with updating data in MongoDB via mongoose. I have a nested Document of the following structure</p>

<pre class="lang-js prettyprint-override"><code>const someSchema:Schema = new mongoose.Schema({
  Title: String,
  Subdocuments: [{
    SomeValue: String
    Position: {
     X: {type: Number, default: 0},
     Y: {type: Number, default: 0},
     Z: {type: Number, default: 0}
    }
  }]  
});

</code></pre>

<p>Now my problem is that I am updating this with findOneAndUpdateById. I have previously set the position to values other than the default. I want to update leaving the position as is by making my request without the Position as my frontend should never update it (another application does).</p>

<p>However the following call</p>

<pre class="lang-js prettyprint-override"><code>const updateById = async (Id: string, NewDoc: DocClass) =&gt; {
    let doc: DocClass | null = await DocumentModel.findOneAndUpdate(
        { _id: Id },
        { $set: NewDoc },
        { new: true, runValidators: true });
    if (!doc) {
        throw createError.documentNotFound(
          { msg: `The Document you tried to update (Id: ${Id}) does not exist` }
        );
    }
    return doc;
}
</code></pre>

<p>Now this works fine if I don't send a Title for the value in the root of the schema (also if i turn on default values for that Title) but if I leave out the Position in the Subdocument it gets reset to the default values X:0, Y:0, Z:0.</p>

<p>Any ideas how I could fix this and don't set the default values on update?</p>

